import Col from 'react-bootstrap/Col';


function App() {
  return (
    <div className="App">
    <Container>
        <h1> Клиент управления СВЧ-коммутаторами</h1>
    </Container>
        <Container>
            <Row>
                <Col md="2">
                    <ServerList/>
                </Col>
                <Col>
                    <AddDevice/>
                </Col>
            </Row>
        </Container>
    </div>
  );
}

export default App;
